("1263","Admin","Added new event","Admin added a new event with description: CALL FOR CHOIR MEMBERS!??\n\nWe are calling all young people who are talented in singing and playing instruments, and want to be a part of Youth Choir at St. James Parish.\n\nMUST BE:\n\n• 12 years old and above\n\n• Already received Holy Communion\n\n• Willing to commit\n\nWe also teach the following instruments:\n\n• PIANO\n\n• DRUMS\n\n• GUITAR\n\nThere will be an Audition this coming Saturday, 8:00 AM at St. James Parish Church. Let us use our talents to serve the Lord, fellow youths! See you!\n\n\"He who sings, prays twice.\" - St. Augustine\n\nFor more infos, you may directly message us through the given contact address below or to \"St. James Youth Ministry\" Official Facebook Page.","2024-05-01 12:04:29"),
