("219","Cuisina Imperia Subic Kitchen","","Santo Thomas","Staff","09171600112","14.856712486505334, 120.25649195678534","Striving to be grand in taste, not in price\n\n\n\n“Success is the product of daily habits—not once-in-a-lifetime transformations.” – James Clear\n\n\n\nAnd Cuisina Imperia is a journey, ongoing.\n\n\n\nThe brand, though formally established in 2021, had already started way before; no one just knew it yet, not even the founders. Starting as an idea during a random coffee lunch during the early Covid pandemic, the founders developed the idea into a dream, and that dream is called Cuisina Imperia.\n\n\n\n\n\n?‍♂️ Dine-in and In-house Delivery\n\nGRABFOOD, FoodPanda, Groover & ORDERMO\n\n\n\n⏰ Open daily 9 AM to 9 PM\n\n\n\n?Cuisina Imperia ® OLONGAPO #1 Fendler Ext., cor Columban St, East Tapinac, Olongapo City. Landmark: Cindy Kelly Hotel near Volunteers Park.\n\n☎️ (0917) 1600 112 or (0970) 330 4597\n\n\n\n?SUBIC KITCHEN #303 Sto. Tomas, Subic. Landmark: Green gate opposite Sto. Tomas School.\n\n☎️ (0917) 819 6473","Open","RESTAURANT","2024-05-14 17:02:59"),
