INSERT INTO places VALUES
("68","Subic Municipal Hall","../../../imageplaces/munisipyo.PNG","Baraca-Camachile","https://web.facebook.com/khonghun","https://twitter.com/mps_subic","Tourism Office","(047)2322990","14.877647913973174, 120.23505344006779","The Municipality of Subic is a vibrant town located in the province of Zambales, Philippines.\n\n\n\nHere are some key details about Subic:\n\n\n\nLocation: Situated along the National Highway, Subic is nestled in the heart of Central Luzon.\n\n\n\nPopulation: The town is home to approximately 105,000 residents.\n\n\n\nGovernment: Subic has its own municipal hall where local governance takes place.\n\n\n\nHistory: Subic has a rich history, and its past mayors have contributed significantly to its development.\n\n\n\nAttractions: Subic boasts scenic landscapes, historical sites, and a thriving community.","Open","MUNICIPAL HALL","2024-02-17 20:51:15"),
("107","Coco Corner Cafe ","../../../imageplaces/175897327_2130081670475779_3806040492816404599_n.jpg","Ilwas","https://web.facebook.com/OconerCocoCorner","","Anne Ramos","09991105394","14.880254802381902, 120.23445332330057","“Wag kana mag tampo, kung hindi ako available kahapon. \n\nParang kaibigan mo lang din ako, minsan kung kelan need na need mo sya, dun pa sya wala.\n\nAng importante, Available na ko today. ?\n\nInit na init kaba? Ako lang ang sagot jan! ? ","Open","COFFEE SHOP","2024-03-12 16:44:18"),
("109","Balon Falls","../../../imageplaces/117240220_126345742496240_8949545687873217664_n.jpg","Aningway-Sacatihan","","","Jovilyn Maglaque","56755","14.924912172984488, 120.24595329137081","Balon Falls\n\nSacatihan, Aningway, Subic, Zambales\n\n\n\nWaterfall cascading over rocks & boulders into a shallow pool, accessible by hikes & bike rides.","Open","FALLS","2024-03-12 18:51:17"),
