("115","Mang Inasal","../../../imageplaces/manginasal.PNG","Baraca-Camachile","","","Mang Inasal Delivery","(047)2326392","14.877070184367017, 120.23507004601964","Here\'s a feast that\'s all for you!\n\nBe the first one to try the NEW #MangInasalSoloFiesta with all your Mang Inasal favorites -- Chicken Inasal, Pork BBQ, Palabok, Lumpiang Togue, Java Rice, and Soup! Now available for dine-in, takeout or delivery!","Open","FAST FOODS","2024-04-08 21:44:25"),
("120","RedDoorz Plus @ JNV Dream Hotel","../../../imageplaces/image_1713486131.jpg","Calapacuan","","","RedDoorz Staff","(02)82498745","14.86357290962586, 120.23480557522693","On a stretch of National Highway 306 lined with businesses, this unassuming budget hotel is 4 km from Adam\'s Beach and 1 km from the Waltermart Subic shopping mall.\n\nFeaturing framed art, the modest rooms offer flat-screen TVs, Wi-Fi and wet bars. All provide air conditioning and en suite wet rooms. Upgraded rooms add sitting areas.\n\nThere\'s an exercise room. Parking is available.","Open","HOTEL","2024-04-19 08:22:11"),
("121","Club Morocco Beach Resort","../../../imageplaces/312181716_6476292992397348_4271213484315597785_n.jpg","Cawag","https://web.facebook.com/pages/Club-Morocco-Subic-Zambales/133792786696543","","Club Morocco Staff","09215498465","14.879678385869031, 120.20208779199137","WE ARE AVAILABLE ONLINE ALL DAY. Just send us a message how we can assist you with your real estate needs.\n\n\n\nFor inquiry, PM is the key.\n\n\n\nBuilding dream. Service with integrity.\n\n\n\nFeaturing balconies, the relaxed rooms come with satellite TV, minibars, and tea and coffeemaking facilities. Suites provide sitting areas, while 1-bedroom villas offer separate living rooms. Room service is available.\n\nAmenities include an airy restaurant, as well as an outdoor pool and a sundeck overlooking the beach. Wi-Fi is free in public areas.","Open","RESORTS AND HOTEL","2024-04-19 08:27:49"),
("124","St. James Parish","../../../imageplaces/image_1714537074.jpg","Asinan Proper","https://web.facebook.com/pages/St-James-Parish-Church/313543209252248","","St. James Staff","09486751108","14.880496220807546, 120.23307019365986","⛪ Saint James Parish Church in Subic, Zambales\n\nSt. James Parish Church is located in Subic, Zambales. They said that the church was actually founded since 1607 but the current building is seemingly a new one. It probably went through a series of restoration and renovation all through the years. The church has a very simple yet unique-looking facade.\n\n? Subic, Zambales, Philippines\n\nLatitude: 14.88020926\n\nLongitude: 120.232953385","Open","CHURCH","2024-05-01 12:17:54"),
("125","Mt. Bukilyaok","../../../imageplaces/image_1714540267.jpg","San Isidro","","","","","14.875425143654198,120.25883777341721","Mt Bukilyaok is a Landmark of Barangay San Isidro and one of our recognized historical properties of Subic, Zambales by the National Commission on Culture and Arts.\n\n Our mangoes are among the sweetest. A farmer from San Isidro, Mr. Garnet Joseph L Arueza was adjudged as among the sweetest mango farmer of them all.  Being an agricultural barangay  we produce palay and vegetables.","Open","SCENIC VIEWS","2024-05-01 13:11:07"),
("126","San Isidro Labrador ","../../../imageplaces/image_1714739523.jpg","San Isidro","https://web.facebook.com/sanisidrochapelsubic","","Church Staff","09278232355","14.865587548499692, 120.25719746493151","SAN ISIDRO LABRADOR is the one of our cultural property\n\n\n\nSAN ISIDRO LABRADOR (SAINT ISIDORE) \n\nSi San Isidro Labrador ay ang patron ng mga magsasaka, manggagawa at rural na komunidad. Siya ay ipinanganak na mahirap ng kanyang mga magulang sa Madrid , Espanya noong taong 1070 at namatay noong Mayo 15, 1130 sa kanyang bayang sinilangan.\n\nSi San Isidro Labrador ay biniyatipikahan noong Mayo 2, 1619 ni Papa Pablo V.","Open","CHURCH","2024-05-03 20:32:03"),
("127","Mt. Balingkilat","../../../imageplaces/image_1714742227.PNG","Cawag","","","Tour Guide","09639953388","14.850910762030892, 120.12853053427077","Mt. Balingkilat, literally the “Mountain of Thunder” in the native Aeta language, is at 1100 MASL one of the highest peaks in the Zambales Coastal Mountains and Coves area, an emerging hiking hotspot within San Antonio and Subic towns that has scenic views and nice trails that interconnect high peaks and beautiful coves.","Open","SCENIC VIEWS","2024-05-03 21:17:07"),
